/**
* Author(s) of this code: 
*
* Joven Manikiza
*/

import { Button, Heading, Main, Paragraph, SectionBreak } from "govuk-react";
import React from "react";
import { useNavigate } from "react-router-dom";
import Navigation from "../../../Navigation";

function NameChangeConfirmation(){

    const navigate = useNavigate();
    const location = useLocation();
    const forename = location.state.forename;
    const surname = location.state.surname;

  const payload = gender;

  const [data, setData] = useState({});

  useEffect(() => {
    fetch("http://localhost:4000/getData.php")
      .then((response) => response.json())
      .then((data) => {
        setData({
          previousGender: data[0].GenderCode,
        });
      })
      .catch((error) => console.error(error));
  }, []);

    console.log("gender:", gender);

const updateGender = () => {
  fetch('http://localhost:4000/updateFullName.php', {
    method: 'PUT',
    headers: {
      'Content-Type': 'application/json'
    },
    body: JSON.stringify({gender: payload}),
    credentials: 'include',
  })
  .then(response => {
    if (!response.ok) {
      throw new Error('Failed to update postcode');
    }
    navigate('/Application');
  })
  .catch(error => console.error(error));
};
    return (
        <div>
                                    <Navigation pageLink1="/" PageName1="home" pageLink2="/login" PageName2="Login" pageLink3="/NhsNumber" PageName3="Register"/>

            <Main>

                <Heading>
                    Confirm your changes
                </Heading>

                <Heading size="MEDIUM">Previous details were:</Heading>
                <SectionBreak></SectionBreak>

                <Paragraph>First name: (Props First name here)</Paragraph>
                <Paragraph>Last name: (Props Last name here)</Paragraph>

                <Heading size="MEDIUM">New details are:</Heading>

                <Paragraph>First name: (Props First name here)</Paragraph>
                <Paragraph>Last name: (Props Last name here)</Paragraph>

                <Table>
                    <Table.Row>
                        <Table.CellHeader>
                            Forename:
                        </Table.CellHeader>
                        <Table.Cell>
                           {data.previousForename}
                        </Table.Cell>
                    </Table.Row>
                    <Table.Row>
                        <Table.CellHeader>
                            Surname:
                        </Table.CellHeader>
                        <Table.Cell>
                           {data.previousSurname}
                        </Table.Cell>
                    </Table.Row>
                </Table>
 
                <Heading size="MEDIUM">New details are:</Heading>

                <Table>
                    <Table.Row>
                        <Table.CellHeader>
                            Forename:
                        </Table.CellHeader>
                        <Table.Cell>
                            {forename}
                        </Table.Cell>
                    </Table.Row>
                    <Table.Row>
                        <Table.CellHeader>
                            Surname:
                        </Table.CellHeader>
                        <Table.Cell>
                            {surname}
                        </Table.Cell>
                    </Table.Row>
                </Table>

                <Button onClick={ () => navigate("/Application")}>
                    Confirm
                </Button>
                                
                <Button onClick={() => navigate("/Profile")} buttonColour="GREY">
                    Cancel
                </Button>       
                
            </Main>
        </div>

    );
}

export default NameChangeConfirmation;
